window.bookSummaryJSON = "<p><b>As the jaws of winter clamp down on the city of Halifax, the light recedes and new terrors arise, in the second book of this werewolf horror series.</b></p> <p>Months after the war with Borland and his vicious werebrood, Kirk and Morris are experiencing curious aftereffects. They’re stronger, faster, and no longer vulnerable to the sharp sting of silver. On the other hand, they're forever hungry, and nothing they eat provides the same nourishment as what they consumed on the island of Newfoundland.</p> <p>When a mysterious stranger rides into Morris’s territory wishing to hunt, the warden knows the visitor isn’t after deer. The ultimate race begins as Kirk and Morris lead a host of wardens to put down one of their own before the next full moon—when an entire city will be subjected to one voracious appetite.</p> <p><i>Breeds 2</i> is the second book in a trilogy of terror sure to please fans of Robert R. McCammon, Maggie Stiefvater, and Chase Novak.</p>"; 
